import React from 'react'
import "./HeaderSection.css"

function HeaderSection() {
  return (
    <div className='Header-container'>
      <img src="../../images/profile.png" alt='profile-pic'></img>
      <h3>My Coding Profiles</h3>
    </div>
  )
}

export default HeaderSection
